import '../App.css';
import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <nav>
            <div className='link-home'>
                <Link to='/'>
                    <h3 className='link'>Cryptography</h3>
                </Link>

                <div>
                    <ul className='links'>
                        <Link className='link' to='/shift'>
                            <li>Shift</li>
                        </Link>
                        <Link className='link' to='/vigenere'>
                            <li>Vigenere</li>
                        </Link>
                        <Link className='link' to='/affine'>
                            <li>Affine</li>
                        </Link>
                    </ul>
                </div>
            </div>
        </nav>
    );
}

export default Nav;
